import React from "react";
import { BrowserRouter,Routes,Route } from "react-router-dom";
import { Nav } from "./Nav";
function Routing()
{
    return(
        <>
            <BrowserRouter>
            <Nav></Nav>
                <Routes>
                    <Route to="/home" />
                </Routes>
            </BrowserRouter>
        </>
    )
}

export {Routing};
